import './Header.css';

function Header() {
  // const showMenu = 
  return (
    <div className="Header">
        <svg 
          className='Menu' xmlns="http://www.w3.org/2000/svg" width="30" fill="#ffd9d3" class="bi bi-list" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5z"/>
        </svg>
        <h1>color sol</h1>
    </div>
  )
};

export default Header;

